<div id="pf1" class="pf w0 h0" data-page-no="1"><div class="pc pc1 w0 h0"><img class="bi x0 y0 w1 h1" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x0 h2 y2 ff1 fs0 fc0 sc0 ls0 ws0">TÉRMIN<span class="_ _0"></span>OS Y CON<span class="_ _0"></span>DICION<span class="ls1">ES</span><span class="ff2 fc1"> </span></div><div class="t m0 x0 h3 y3 ff3 fs1 fc2 sc0 ls0 ws0">PRIMERO: GENERAL<span class="_ _0"></span>IDADES<span class="ff2"> </span></div><div class="t m0 x0 h4 y4 ff2 fs1 fc2 sc0 ls0 ws0">Bienvenido a<span class="_ _0"></span> Locos x Chiloé. Este docu<span class="_ _0"></span>mento regula los tér<span class="_ _0"></span>minos y condiciones b<span class="_ _0"></span>ajo los </div><div class="t m0 x0 h4 y5 ff2 fs1 fc2 sc0 ls0 ws0">cuales Ud. tien<span class="_ _0"></span>e derecho a acceder y<span class="_ _0"></span> usar los servicios de<span class="_ _0"></span>l sitio Web <span class="_ _1"></span>www<span class="_ _0"></span>.locosxchiloe.cl <span class="ls2">y </span></div><div class="t m0 x0 h4 y6 ff2 fs1 fc2 sc0 ls0 ws0">de cualquie<span class="_ _0"></span>r información, texto, vid<span class="_ _0"></span>eo u otro material comunicado<span class="_ _0"></span> en el sitio web. </div><div class="t m0 x0 h4 y7 ff2 fs1 fc2 sc0 ls0 ws0">En este sitio <span class="_ _0"></span>W<span class="_ _1"></span>eb<span class="_ _0"></span> podrá usar, sin costo<span class="_ _0"></span>, el software<span class="_ _0"></span> y las aplicacione<span class="_ _0"></span>s para equipos móvile<span class="_ _0"></span>s </div><div class="t m0 x0 h4 y8 ff2 fs1 fc2 sc0 ls0 ws0">que le pe<span class="_ _0"></span>rmitan navegar, visitar, comparar y si lo<span class="_ _0"></span> desea, adquirir los bienes o servicios qu<span class="_ _0"></span>e </div><div class="t m0 x0 h4 y9 ff2 fs1 fc2 sc0 ls0 ws0">se exhiben aqu<span class="_ _0"></span>í. </div><div class="t m0 x0 h4 ya ff2 fs1 fc2 sc0 ls0 ws0">Le recomendamos que<span class="_ _0"></span> lea detenida<span class="_ _0"></span>mente estas Condici<span class="_ _0"></span>ones e imprima o guard<span class="_ _0"></span>e una copia </div><div class="t m0 x0 h4 yb ff2 fs1 fc2 sc0 ls0 ws0">de las mismas en la un<span class="_ _0"></span>idad de<span class="_ _0"></span> disco local para su información<span class="_ _0"></span>. </div><div class="t m0 x0 h4 yc ff2 fs1 fc2 sc0 ls0 ws0">El uso de este siti<span class="_ _0"></span>o web, la aplicaci<span class="_ _0"></span>ón de estos Términos y Condiciones, los actos que<span class="_ _0"></span> </div><div class="t m0 x0 h4 yd ff2 fs1 fc2 sc0 ls0 ws0">ejecute y los co<span class="_ _0"></span>ntratos que cel<span class="_ _0"></span>ebre por medio de este si<span class="_ _0"></span>tio web, se encuen<span class="_ _0"></span>tran sujetos y </div><div class="t m0 x0 h4 ye ff2 fs1 fc2 sc0 ls0 ws0">sometidos a las ley<span class="_ _0"></span>es de la Repúbli<span class="_ _0"></span>ca de Chile y en<span class="_ _0"></span> especial a la ley 19.496 de<span class="_ _0"></span> protección </div><div class="t m0 x0 h4 yf ff2 fs1 fc2 sc0 ls0 ws0">de los dere<span class="_ _0"></span>chos de los consumidores. </div><div class="t m0 x0 h4 y10 ff2 fs1 fc2 sc0 ls0 ws0">Locos x Chiloé po<span class="_ _0"></span>r lo tanto, aplicará estricta<span class="_ _0"></span>mente todos los ben<span class="_ _0"></span>eficios, garantías y </div><div class="t m0 x0 h4 y11 ff2 fs1 fc2 sc0 ls0 ws0">derechos re<span class="_ _0"></span>conocidos en favor de los consumido<span class="_ _0"></span>res en la ley 1<span class="_ _0"></span>9.496. Además, Locos x </div><div class="t m0 x0 h4 y12 ff2 fs1 fc2 sc0 ls0 ws0">Chiloé adhiere<span class="_ _0"></span> en todas sus partes al Có<span class="_ _0"></span>digo de Buen<span class="_ _0"></span>as Prácticas para el Comercio </div><div class="t m0 x0 h4 y13 ff2 fs1 fc2 sc0 ls0 ws0">Electrónico de<span class="_ _0"></span> la Cámara de Comercio de Santiag<span class="_ _0"></span>o.<span class="_ _1"></span> </div><div class="t m0 x0 h4 y14 ff2 fs1 fc2 sc0 ls0 ws0"> </div><div class="t m0 x0 h3 y15 ff3 fs1 fc2 sc0 ls0 ws0">SEGUNDO: COMUNICA<span class="_ _0"></span>CIONES<span class="ff2"> </span></div><div class="t m0 x0 h4 y16 ff2 fs1 fc2 sc0 ls0 ws0">Para la co<span class="_ _0"></span>municación de cualquier pre<span class="_ _0"></span>sentación, consulta o recl<span class="_ _0"></span>amo a propósito del uso<span class="_ _0"></span> de </div><div class="t m0 x0 h4 y17 ff2 fs1 fc2 sc0 ls0 ws0">este sitio, o los con<span class="_ _0"></span>tratos que en é<span class="_ _0"></span>l se lleven a cabo<span class="_ _0"></span>, Locos x Chiloé design<span class="_ _0"></span>a como </div><div class="t m0 x0 h4 y18 ff2 fs1 fc2 sc0 ls0 ws0">representa<span class="_ _0"></span>nte especial a don/doña Le<span class="_ _0"></span>onardo Castillo Barria<span class="_ _0"></span>, Director Comercial, dispon<span class="_ _0"></span>ible </div><div class="t m0 x0 h4 y19 ff2 fs1 fc2 sc0 ls0 ws0">en el correo ven<span class="_ _0"></span>tas@LocosxChiloe.cl; y e<span class="_ _0"></span>n el teléfono de Serv<span class="_ _0"></span>icio al Cliente 957001623, </div><div class="t m0 x0 h4 y1a ff2 fs1 fc2 sc0 ls0 ws0">domiciliado<span class="_ _0"></span> para estos efectos en calle Filod<span class="_ _0"></span>endro cinco 18<span class="_ _0"></span>35, comuna de Maipú<span class="_ _0"></span>, ciudad de </div><div class="t m0 x0 h4 y1b ff2 fs1 fc2 sc0 ls0 ws0">Santiago. Su p<span class="_ _0"></span>ersonería para actua<span class="_ _0"></span>r por Locos x Chi<span class="_ _0"></span>loé costa en escritura<span class="_ _0"></span> pública de fecha </div><div class="t m0 x0 h4 y1c ff2 fs1 fc2 sc0 ls0 ws0">cinco de ab<span class="_ _0"></span>ril del año dos mil dieciocho oto<span class="_ _0"></span>rgada en la No<span class="_ _0"></span>taría de Santiago de<span class="_ _0"></span> don Manuel </div><div class="t m0 x0 h4 y1d ff2 fs1 fc2 sc0 ls0 ws0">C. P. Cammas Monte<span class="_ _0"></span>s. </div><div class="t m0 x0 h4 y1e ff2 fs1 fc2 sc0 ls0 ws0">Locos x Chiloé se o<span class="_ _0"></span>bliga a que en caso<span class="_ _0"></span> de enviarle informac<span class="_ _1"></span>ión p<span class="_ _0"></span>ublicitaria o pro<span class="_ _0"></span>mocional, </div><div class="t m0 x0 h4 y1f ff2 fs1 fc2 sc0 ls0 ws0">por correo ele<span class="_ _0"></span>ctrónico, ésta contend<span class="_ _0"></span>rá al menos la siguien<span class="_ _0"></span>te información:<span class="_ _1"></span> </div><div class="t m0 x0 h4 y20 ff2 fs1 fc2 sc0 ls3 ws0">a)<span class="ls0">    Identificación del <span class="_ _0"></span>mensaje, que lo ha<span class="_ _0"></span>ga reconocible como publicid<span class="_ _0"></span>ad o comunicación </span></div><div class="t m0 x0 h4 y21 ff2 fs1 fc2 sc0 ls0 ws0">promocional, en<span class="_ _0"></span> el campo de asun<span class="_ _0"></span>to del mensaje. </div><div class="t m0 x0 h4 y22 ff2 fs1 fc2 sc0 ls0 ws0">b)     Existencia<span class="_ _0"></span> del derecho del consumidor o usu<span class="_ _0"></span>ario a solicitar el<span class="_ _0"></span> cese de envíos de </div><div class="t m0 x0 h4 y23 ff2 fs1 fc2 sc0 ls0 ws0">publicidad de e<span class="_ _0"></span>se tipo por Locos x<span class="_ _0"></span> Chiloé y la obliga<span class="_ _0"></span>ción de Locos x Chiloé de<span class="_ _0"></span> suspender </div><div class="t m0 x0 h4 y24 ff2 fs1 fc2 sc0 ls0 ws0">esos envíos. </div><div class="t m0 x0 h4 y25 ff2 fs1 fc2 sc0 ls4 ws0">c) <span class="ls0">    Un procedi<span class="_ _0"></span>miento simple y eficaz pa<span class="_ _0"></span>ra que el consumidor pued<span class="_ _0"></span>a hacer esa solicitud, </span></div><div class="t m0 x0 h4 y26 ff2 fs1 fc2 sc0 ls0 ws0">indicando una d<span class="_ _0"></span>irección electrónica p<span class="_ _0"></span>ara estos efectos. </div><div class="t m0 x0 h4 y27 ff2 fs1 fc2 sc0 ls0 ws0">d)     La Identificación d<span class="_ _0"></span>el anuncian<span class="_ _0"></span>te con su deno<span class="_ _0"></span>minación comercial. </div><div class="t m0 x0 h4 y28 ff2 fs1 fc2 sc0 ls0 ws0">Tratándose de<span class="_ _0"></span> publicidad teaser, se cu<span class="_ _0"></span>mplirá con las ob<span class="_ _0"></span>ligaciones señaladas </div><div class="t m0 x0 h4 y29 ff2 fs1 fc2 sc0 ls0 ws0">precedente<span class="_ _0"></span>mente en la medida que se<span class="_ _0"></span> identif<span class="_ _1"></span>ique<span class="_ _0"></span> la agencia que rea<span class="_ _0"></span>liza la misma. </div><div class="t m0 x0 h4 y2a ff2 fs1 fc2 sc0 ls0 ws0">Locos x Chiloé cesa<span class="_ _0"></span>rá el envío de los <span class="_ _0"></span>mensajes publicitarios o promocio<span class="_ _0"></span>nales por correo </div><div class="t m0 x0 h4 y2b ff2 fs1 fc2 sc0 ls0 ws0">electrónico<span class="_ _0"></span> u otros medios de co<span class="_ _0"></span>municación individua<span class="_ _0"></span>l equivalentes, a toda<span class="_ _0"></span> persona que </div><div class="t m0 x0 h4 y2c ff2 fs1 fc2 sc0 ls0 ws0">hubiere soli<span class="_ _0"></span>citado expresamente la suspen<span class="_ _0"></span>sión de esos envíos. </div></div><a class="l" href="http://www.locosxchiloe.cl/"><div class="d m1" style="border-style:none;position:absolute;left:423.220000px;bottom:658.620000px;width:106.760000px;height:14.870000px;background-color:rgba(255,255,255,0.000001);"></div></a></div><div class="pi" data-data='{"ctm":[1.000000,0.000000,0.000000,1.000000,0.000000,0.000000]}'></div></div>
<div id="pf2" class="pf w0 h0" data-page-no="2"><div class="pc pc2 w0 h0"><img class="bi x0 y2d w3 h5" alt="" src="data:image/png;base64,"/><div class="c x1 y1 w2 h0"><div class="t m0 x0 h4 y2e ff2 fs1 fc2 sc0 ls0 ws0"> </div><div class="t m0 x0 h3 y2f ff3 fs1 fc2 sc0 ls0 ws0"> </div><div class="t m0 x0 h3 y30 ff3 fs1 fc2 sc0 ls0 ws0">TERCERO: LIBERTAD<span class="_ _0"></span> DE NAVEGACIÓN y ACEPTA<span class="_ _0"></span>CIÓN DE LOS TÉRMINOS<span class="_ _0"></span> Y </div><div class="t m0 x0 h3 y31 ff3 fs1 fc2 sc0 ls0 ws0">CONDICIONES<span class="ff2"> </span></div><div class="t m0 x0 h4 y32 ff2 fs1 fc2 sc0 ls0 ws0">La mera visita de<span class="_ _0"></span> este sitio no impone nin<span class="_ _0"></span>gún tipo de ob<span class="_ _0"></span>ligación para el usuario<span class="_ _0"></span>, a menos </div><div class="t m0 x0 h4 y33 ff2 fs1 fc2 sc0 ls0 ws0">que éste exp<span class="_ _0"></span>rese de forma inequívo<span class="_ _0"></span>ca, por medio de acto<span class="_ _0"></span>s positivos, s<span class="_ _1"></span>u vo<span class="_ _0"></span>luntad de </div><div class="t m0 x0 h4 y34 ff2 fs1 fc2 sc0 ls0 ws0">contratar con la<span class="_ _0"></span> empresa para adquirir b<span class="_ _0"></span>ienes o servicios, en<span class="_ _0"></span> la forma indicada en<span class="_ _0"></span> estos </div><div class="t m0 x0 h4 y35 ff2 fs1 fc2 sc0 ls0 ws0">términos y condi<span class="_ _0"></span>ciones. </div><div class="t m0 x0 h4 y36 ff2 fs1 fc2 sc0 ls0 ws0">Para aceptar esto<span class="_ _0"></span>s Términos y Condi<span class="_ _0"></span>ciones, el usuario de<span class="_ _0"></span>berá hacer click donde el<span class="_ _0"></span> sitio </div><div class="t m0 x0 h4 y37 ff2 fs1 fc2 sc0 ls0 ws0">web de Lo<span class="_ _0"></span>cos x Chiloé ofrezca esta opci<span class="_ _0"></span>ón <span class="ff4">en la interfaz del usuario con la frase “he le<span class="_ _0"></span>ído y </span></div><div class="t m0 x0 h6 y38 ff4 fs1